import { ClientsSection } from "./ClientsSection";
import { FeaturedProductsSection } from "./FeaturedProductsSection";
import { FooterSection } from "./FooterSection";
import { HeaderSection } from "./HeaderSection";
import { WelcomeSection } from "./WelcomeSection";

export const Homepage = () => {
  const featuredProducts = [
    {
      id: 1,
      title: "Dosing System",
    },
    {
      id: 2,
      title: "Seal auxiliary systems",
    },
    {
      id: 3,
      title: "Control & Instrumentation",
    },
    {
      id: 4,
      title: "Lube Oil Systems",
    },
    {
      id: 5,
      title: "Fuel Oil Systems",
    },
  ];

  return (
    <div className="bg-white w-full">
      {/* Hero Section with Background */}
      <div className="relative min-h-screen bg-gradient-to-b from-gray-900 to-gray-700">
        <HeaderSection />
        <WelcomeSection />
      </div>
      
      {/* Main Content Sections */}
      <FeaturedProductsSection />
      
      {/* Featured Products Section */}
      <section className="py-16 px-4 sm:px-6 lg:px-8">
        <div className="max-w-7xl mx-auto">
          {/* Featured Products Title */}
          <h2 className="text-center text-4xl sm:text-5xl lg:text-6xl font-extrabold mb-8">
            <span className="text-black">Featured </span>
            <span className="text-[#fbcc00]">Products</span>
          </h2>

          {/* Divider Line */}
          <div className="w-full h-1 bg-gray-300 mb-12" />

          {/* Products Grid */}
          <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-8 mb-16">
            {featuredProducts.slice(0, 3).map((product) => (
              <div key={product.id} className="flex flex-col items-center">
                <div className="w-full aspect-square bg-gray-200 rounded-lg flex items-center justify-center mb-4 hover:bg-gray-300 transition-colors">
                  <span className="text-gray-500 text-lg text-center px-4">{product.title}</span>
                </div>
                <div className="flex items-center gap-3">
                  <div className="w-10 h-10 bg-[#fbcc00] rounded-lg flex-shrink-0" />
                  <span className="font-semibold text-gray-800 text-lg">{product.title}</span>
                </div>
              </div>
            ))}
          </div>

          {/* Second Row - Centered */}
          <div className="grid grid-cols-1 sm:grid-cols-2 gap-8 max-w-4xl mx-auto">
            {featuredProducts.slice(3).map((product) => (
              <div key={product.id} className="flex flex-col items-center">
                <div className="w-full aspect-square bg-gray-200 rounded-lg flex items-center justify-center mb-4 hover:bg-gray-300 transition-colors">
                  <span className="text-gray-500 text-lg text-center px-4">{product.title}</span>
                </div>
                <div className="flex items-center gap-3">
                  <div className="w-10 h-10 bg-[#fbcc00] rounded-lg flex-shrink-0" />
                  <span className="font-semibold text-gray-800 text-lg">{product.title}</span>
                </div>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* Clients Section with Yellow Background */}
      <section className="bg-[#eec755] py-16">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="grid grid-cols-1 lg:grid-cols-2 gap-12 items-center">
            <ClientsSection />
            
            {/* Industrial Equipment Image */}
            <div className="w-full aspect-[4/3] bg-gray-300 rounded-lg flex items-center justify-center">
              <span className="text-gray-600 text-xl">Industrial Equipment</span>
            </div>
          </div>

          {/* Client Logos Grid */}
          <div className="mt-16">
            <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-6">
              {[1, 2, 3, 4].map((id) => (
                <div
                  key={id}
                  className="bg-white rounded-2xl p-8 shadow-lg flex items-center justify-center aspect-[2/1]"
                >
                  <span className="text-gray-400 font-medium">Client Logo {id}</span>
                </div>
              ))}
            </div>
          </div>

          {/* Dots Indicator */}
          <div className="flex justify-center mt-8">
            <div className="flex space-x-2">
              {[1, 2, 3, 4].map((dot) => (
                <div key={dot} className="w-3 h-3 bg-gray-400 rounded-full" />
              ))}
            </div>
          </div>
        </div>
      </section>

      {/* Footer Section */}
      <footer className="bg-[#0e0e0e] text-white py-16">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="grid grid-cols-1 lg:grid-cols-3 gap-12">
            {/* Company Info */}
            <div className="lg:col-span-1">
              <div className="w-full max-w-sm h-28 bg-gray-700 rounded flex items-center justify-center mb-6">
                <span className="text-white font-bold text-xl">PSI Engineering Systems</span>
              </div>
              <p className="text-gray-400 text-lg leading-relaxed mb-8">
                We design and deliver reliable auxiliary systems for oil & gas,
                power, and process industries—ensuring efficiency, safety, and
                uninterrupted operations across every stage of your plant.
              </p>
              
              {/* Social Icons */}
              <div className="flex space-x-4">
                {['FB', 'TW', 'IN', 'YT'].map((social) => (
                  <div key={social} className="w-12 h-12 bg-gray-600 rounded-full flex items-center justify-center hover:bg-gray-500 transition-colors cursor-pointer">
                    <span className="text-white text-xs font-bold">{social}</span>
                  </div>
                ))}
              </div>
            </div>

            {/* Footer Navigation */}
            <div className="lg:col-span-2">
              <FooterSection />
            </div>
          </div>

          {/* Copyright */}
          <div className="border-t border-gray-600 mt-12 pt-8">
            <p className="text-center text-gray-400 text-lg">
              © Copyright ©2025 PSI. All Rights Reserved Copyright
            </p>
          </div>
        </div>
      </footer>
    </div>
  );
};
